import React, { useState } from 'react'
import styled from 'styled-components'

interface MemberBoxProps {
  clickedAccountList: Array<string>
  account_id: string
  birth_date: string
  gender: string
  name: string
  phone_number: string
}

export const MemberBox = (props: MemberBoxProps) => {
  const {
    clickedAccountList,
    account_id,
    birth_date,
    gender,
    name,
    phone_number,
  } = props
  const [clicked, setClicked] = useState(false)

  return (
    <div
      style={{
        background: clicked ? '#F0F1F3' : '#ffffff',
        display: 'flex',
        flexDirection: 'row',
      }}
    >
      {account_id}, {birth_date}, {gender}, {name}, {phone_number}
    </div>
  )
}
